perspectives.style:
@view "Overall View" {
  @import "base-settings";
  @settings {
  template: causal-loop;
  showcase: ["tags"!="objective hide tag"] !strict;
  }

}

@view "Success and Stress Group" {
  @import "base-settings";
  @settings {
  template: causal-loop;
  showcase: ["tags"="Academics and Stress"] !strict;
  }

}

@view "Transition to College Group" {
  @import "base-settings";

  @settings {
  template: causal-loop;
  showcase: ["tags"="Transition to college"], !strict;
  }

}

@view "Hustle Culture Group" {
  @import "base-settings";

  @settings {
  template: causal-loop;
  showcase: ["tags"="Hustle Culture"], !strict;
  }

}

@view "Help Seeking Group" {
  @import "base-settings";

  @settings {
  template: causal-loop;
  showcase: ["tags"="Help Seeking"], !strict;
  }

}

@controls {
  top {
    view-toggle {
      options: "Overall View", "Success and Stress Group", "Help Seeking Group", "Hustle Culture Group", "Transition to College Group";
      as: buttons;
    }
  }

  bottom-left {}
}

@settings {
  template: causal-loop;
  showcase: ["tags"!="objective hide tag"] !strict;
  background-color: white;
}

@settings {
  template: causal-loop;
}

/* Academic Elements */
element["tags"="Academics"] {
  color: #FADE4C;
}

/* Campus Culture Elements */
element["tags"="Campus Culture"] {
  color: #587537;
}

/* Community Elements */
element["tags"="The Community"] {
  color: #A4D4FC;
}

/* Mental Health Resource Elements */
element["tags"="Mental Health Resources"] {
  color: #487bba;
}

@settings {
  template: causal-loop;
}

/* opposite */
connection["connection type"="-"] {
  color: #d93e4a;
}

@settings {
  template: causal-loop;
  layout: force;
  layout-preset: dense;
}

@controls {
  bottom {
    filter {
      target: element;
      by: "element type";
      as: buttons;
      multiple: true;
      default: show-all;
    }

    filter {
      target: element;
      by: "element type";
      as: buttons;
      multiple: true;
      default: show-all;
    }
  }
}

@settings {
  template: systems;
  layout: static;
  layout-x: "field1";
  layout-y: "field2";
  font-size: 35;
  font-color: #000000;
}

/* Influence */
element["size"] {
  scale: scale("size", 1, 1.9);
}

/* Quaternary Interest */
element["interest"="1"] {
  color: #cbdff1;
}

/* Tertiary Interest */
element["interest"="3"] {
  color: #82bbdb;
}

/* Secondary Interest */
element["interest"="4"] {
  color: #59a2cf;
}

/* Direct Interest */
element["interest"="5"] {
  color: #1b6ab0;
}

@settings {
  template: causal-loop;
  layout: static;
  layout-preset: dense;
}

element["tags"*="Resources"] {
  color: #487bba;
}

connection {
  color: ccc;
}

@settings {
  template: causal-loop;
}

/* Campus Culture Elements */
element["tags"="Campus Culture"] {
  color: #587537;
}

/* Individual Student Elements */
element["tags"="The Student"] {
  color: #5F9D90;
}

/* Mental Health Resource Elements */
element["tags"="Mental Health Resources"] {
  color: #487bba;
}

/* Academic Elements */
element["tags"="Academics"] {
  color: #FADE4C;
}

/* Community Elements */
element["tags"="The Community"] {
  color: #A4D4FC;
}

connection["connection type"="+"] {
  color: ccc;
}

connection["connection type"="-"] {
  color: ccc;
}

@view "Overall View" {
  @import "base-settings";
  @settings {
  template: causal-loop;
  showcase: ["tags"!="objective hide tag"] !strict;
  }

}

@view "Social Determinants" {
  @import "base-settings";
  @settings {
  template: causal-loop;
  showcase: ["tags"="social determinants"] !strict;
  }

}

@view "Protective Factors" {
  @import "base-settings";

  @settings {
  template: causal-loop;
  showcase: ["tags"="protective factors"], !strict;
  }

}

@view "Identity Stressors" {
  @import "base-settings";

  @settings {
  template: causal-loop;
  showcase: ["tags"="identity stressors"], !strict;
  }

}

@controls {
  top {
    view-toggle {
      options: "Overall View", "Social Determinants", "Protective Factors", "Identity Stressors";
      as: buttons;
    }
  }

  bottom-left {}
}

@settings {
  template: causal-loop;
  showcase: ["tags"!="objective hide tag"] !strict;
}

@controls {
  bottom {
    filter {
      target: element;
      by: "element type";
      as: buttons;
      multiple: true;
      default: show-all;
    }

    filter {
      target: element;
      by: "element type";
      as: buttons;
      multiple: true;
      default: show-all;
    }
  }
}

@settings {
  template: stakeholder;
  layout: static;
  layout-x: "field1";
  layout-y: "field2";
}

/* Outside Influencers */
element["tags"*="Financial"] {
  color: #74c89e;
  shape: circle;
}

/* Campus */
element["tags"*="Campus"] {
  color: #776db3;
}

/* Target Population */
element["tags"*="community"] {
  color: #80b8d7;
}

/* Influence (Ability to influence mental health ecosystem change) */
element["size"] {
  scale: scale("size", 1, 3);
}

@settings {
  template: systems;
  element-size: 100;
  font-size: 45;
  font-color: #000000;
}

/* Mental Health Outcomes */
element["tags"="outcome"] {
  color: #746CB4;
}

/* Campus Culture Elements */
element["tags"="Campus Culture"] {
  color: #587537;
}

/* Individual Student Elements */
element["tags"="The Student"] {
  color: #5F9D90;
}

/* Academic Elements */
element["tags"="Academics"] {
  color: #FADE4C;
}

/* Mental Health Resource Elements */
element["tags"="Mental Health Resources"] {
  color: #487bba;
}

/* Community Elements */
element["tags"="The Community"] {
  color: #A4D4FC;
}

/* Root Cause */
element["element type"="Root Cause"] {
  shadow-color: #543005;
  shadow-opacity: 0.3;
  shadow-size: 2;
}
